-- ----------------------------
-- View structure for `ssc_fcoin_bet`
-- ----------------------------
DROP VIEW IF EXISTS `ssc_fcoin_bet`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ssc_fcoin_bet` AS select `b`.`id` AS `betId`,`b`.`type` AS `type`,`b`.`playedId` AS `playedId`,`b`.`uid` AS `uid`,`b`.`username` AS `username`,`b`.`actionNo` AS `actionNo`,`b`.`actionTime` AS `actionTime`,`l`.`info` AS `info`,`l`.`liqType` AS `liqType`,`l`.`fcoin` AS `fcoin` from (`xy_coin_log` `l` join `xy_bets` `b`) where ((`b`.`id` = `l`.`extfield0`) and (`b`.`isDelete` = 0) and (`b`.`lotteryNo` = '') and (`l`.`liqType` between 101 and 102)) ;

-- ----------------------------
-- View structure for `ssc_fcoin_cash`
-- ----------------------------
DROP VIEW IF EXISTS `ssc_fcoin_cash`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ssc_fcoin_cash` AS select `r`.`id` AS `rid`,`l`.`uid` AS `uid`,`r`.`actionTime` AS `actionTime`,`l`.`info` AS `info`,`l`.`liqType` AS `liqType`,`l`.`fcoin` AS `fcoin` from (`xy_member_cash` `r` join `xy_coin_log` `l`) where ((`l`.`extfield0` = `r`.`id`) and (`r`.`state` = 1) and (`r`.`isDelete` = 0) and (`l`.`liqType` = 106)) ;

-- ----------------------------
-- View structure for `ssc_fcoin_znz`
-- ----------------------------
DROP VIEW IF EXISTS `ssc_fcoin_znz`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ssc_fcoin_znz` AS select `b`.`id` AS `betId`,`b`.`type` AS `type`,`b`.`playedId` AS `playedId`,`b`.`qz_uid` AS `qz_uid`,`b`.`qz_username` AS `qz_username`,`b`.`actionNo` AS `actionNo`,`b`.`qz_time` AS `qz_Time`,`l`.`info` AS `info`,`l`.`liqType` AS `liqType`,`l`.`fcoin` AS `fcoin` from (`funyule`.`ssc_coin_log` `l` join `funyule`.`ssc_bets` `b`) where ((`b`.`id` = `l`.`extfield0`) and (`b`.`isDelete` = 0) and (`b`.`lotteryNo` = '') and (`l`.`liqType` = 100)) ;
DROP TRIGGER IF EXISTS `trig_recharge_update`;
DELIMITER ;;
CREATE TRIGGER `trig_recharge_update` AFTER UPDATE ON `xy_member_recharge` FOR EACH ROW BEGIN
IF OLD.state = 1 OR OLD.state = 9 THEN
     IF OLD.flag = 0   THEN
          if NEW.amount>0 AND NEW.isDelete = 0 AND NEW.flag = 1 THEN
               -- 每次充值赠送
			   call setRechargeBack(NEW.amount, NEW.uid, NEW.id, NEW.rechargeId);
         end if;
     END IF;
END IF;
END
;;
DELIMITER ;
